import TableItem from './TableItem'


function Table() {
    const items = ['mela', 'banana', 'kiwi'];
  return (
    <div className="Table">
          <TableItem name="melon" />
          <TableItem name="gurke" />
          {items.map(item => <TableItem name="gurke" />)}
    </div>
  );
}

export default Table;
